    "country": ["Cayman Islands"],
    "economy": ["With no direct taxation, the islands are a thriving offshore financial center. More than 68,000 companies were registered in the Cayman Islands as of 2003, including almost 500 banks, 800 insurers, and 5,000 mutual funds. a stock exchange was opened in 1997. Tourism is also a mainstay, accounting for about 70% of GDP and 75% of foreign currency earnings. the tourist industry is aimed at the luxury market and caters mainly to visitors from North America. Total tourist arrivals exceeded 2.1 million in 2003, with about half from the US. About 90% of the islands' food and consumer goods must be imported. the Caymanians enjoy one of the highest outputs per capita and one of the highest standards of living in the world."],
