    "country": ["El Salvador"],
    "economy": ["The smallest country in Central America, El Salvador has the third largest economy, but growth has been modest in recent years. Robust growth in non-traditional exports have offset declines in the maquila exports, while remittances and external aid offset the trade deficit from high oil prices and strong import demand for consumer and intermediate goods. El Salvador leads the region in remittances per capita with inflows equivalent to nearly all export income. Implementation in 2006 of the Central America-Dominican Republic Free Trade Agreement (CAFTA), which El Salvador was the first to ratify, has strengthened an already positive export trend. With the adoption of the US dollar as its currency in 2001, El Salvador lost control over monetary policy and must concentrate on maintaining a disciplined fiscal policy. the current government has pursued economic diversification, with some success in promoting textile production, international port services, and tourism through tax incentives. It is committed to opening the economy to trade and investment, and has embarked on a wave of privatizations extending to telecom, electricity distribution, banking, and pension funds. in late 2006, the government and the Millennium Challenge Corporation signed a five-year, $461 million compact to stimulate economic growth and reduce poverty in the country's northern region through investments in education, public services, enterprise development, and transportation infrastructure."],
