    "country": ["Bolivia"],
    "economy": ["Bolivia is one of the poorest and least developed countries in Latin America. Following a disastrous economic crisis during the early 1980s, reforms spurred private investment, stimulated economic growth, and cut poverty rates in the 1990s. the period 2003-05 was characterized by political instability, racial tensions, and violent protests against plans - subsequently abandoned - to export Bolivia's newly discovered natural gas reserves to large northern hemisphere markets. in 2005, the government passed a controversial hydrocarbons law that imposed significantly higher royalties and required foreign firms then operating under risk-sharing contracts to surrender all production to the state energy company, which was made the sole exporter of natural gas. the law also required that the state energy company regain control over the five companies that were privatized during the 1990s - a process that is still underway. in 2006, higher earnings for mining and hydrocarbons exports pushed the current account surplus to about 12% of GDP and the government's higher tax take produced a fiscal surplus after years of large deficits. Debt relief from the G8 - announced in 2005 - also has significantly reduced Bolivia's public sector debt burden. Private investment as a share of GDP, however, remains among the lowest in Latin America, and inflation reached double-digit levels in 2007."],
