    "country": ["Brazil"],
    "economy": ["Characterized by large and well-developed agricultural, mining, manufacturing, and service sectors, Brazil's economy outweighs that of all other South American countries and is expanding its presence in world markets. Having weathered 2001-03 financial turmoil, capital inflows are regaining strength and the currency has resumed appreciating. the appreciation has slowed export volume growth, but since 2004, Brazil's growth has yielded increases in employment and real wages. the resilience in the economy stems from commodity-driven current account surpluses, and sound macroeconomic policies that have bolstered international reserves to historically high levels, reduced public debt, and allowed a significant decline in real interest rates. a floating exchange rate, an inflation-targeting regime, and a tight fiscal policy are the three pillars of the economic program. From 2003 to 2007, Brazil ran record trade surpluses and recorded its first current account surpluses since 1992. Productivity gains coupled with high commodity prices contributed to the surge in exports. Brazil improved its debt profile in 2006 by shifting its debt burden toward real denominated and domestically held instruments. LULA DA SILVA restated his commitment to fiscal responsibility by maintaining the country's primary surplus during the 2006 election. Following his second inauguration, LULA DA SILVA announced a package of further economic reforms to reduce taxes and increase investment in infrastructure. the government's goal of achieving strong growth while reducing the debt burden is likely to create inflationary pressures."],
